import React from 'react';
import {Menu, Message} from 'semantic-ui-react';

export default () => {
  return (
    <Menu tabular>
      <Menu.Item header
        name='BREAK RANDOMIZER'
      />
      <Menu.Item
        name='bio'
      />
      <Menu.Item
        name='photos'
      />
    </Menu>
  );
}
